window.bookSummaryJSON = "<p>In the newest nonstop adventure from <i>New York Times</i> best-selling author Stuart Woods, the protégé will become the hero: Now is the time of Herbie Fisher. </p> <p>Under the tutelage of Stone Barrington, Herbie Fisher has transformed from a bumbling sad sack into a capable man about town and the youngest partner at the white-shoe law firm Woodman &amp; Weld. Now all of his training will be put to the test as he finds himself embroiled in his most daring adventure to date. </p>"; 
